import React, { Component } from "react";

class SocialMedia extends Component {
  render() {
    return (
        <div> 
            Social Media
            <iframe width="320" height="440" src="http://instagram.com/p/qbq6fIJMVZ/embed" frameborder="0"></iframe>
        </div>
    );
  }
}

export default SocialMedia;
